import './Register.css'
import React,{useRef,useEffect,useState}from 'react'
import { Link } from 'react-router-dom';
import {useFormik} from 'formik'


export const Register = () => {
    var uref=useRef();
    var eref=useRef();
    var pnref=useRef();
    var pref=useRef();
    var cpref=useRef()

    const formik=useFormik({
        initialValues:{
            username:'',
            email:'',
            phonenumber:'',
            password:'',
            confirmpassword:''

        },
        onSubmit:(values)=>{
            
            console.log(values)

        },
        validate:(values)=>{

        }
    })

    
    
  return (
     
    <div className="pt-5">  
            <div className="global-container  main">  
                <div className="card login-form car">  
                    <div className="card-body">  
                        <h3 className="card-title text-center">  Register  </h3>  
                        <div className="card-text">  
                            <form onSubmit={formik.handleSubmit} >  
                                  
                                    
                                    <input type="text" name="username" placeholder="Username"className="form-control form-control-sm mt-3" autoComplete='new-password' {...formik.getFieldProps('username')} required ref={uref}/>  
                                
                                
                                     
                                    <input type="email" name="email" placeholder="Email Id" className="form-control form-control-sm mt-3" autoComplete='new-password'  {...formik.getFieldProps('email')} required ref={eref}/>  
                                
                                     
                                    <input type="number" name="phonenumber"  placeholder="phone Numer" className="form-control form-control-sm mt-3" autoComplete='new-password'  {...formik.getFieldProps('phonenumber')} required ref={pnref}/>  
                                
                                    <input type="password"  name="password"  placeholder="Password"  className="form-control form-control-sm mt-3" autoComplete='new-password' {...formik.getFieldProps('password')} ref={pref}/>  
                                  
                                    
                                    <input type="password" name="confirmpassword"  placeholder="Confirm  Password" className="form-control form-control-sm mt-3" autoComplete='new-password' {...formik.getFieldProps('confirmpassword')} required ref={cpref} />  
                               
                                  
                                <button type="submit" className="btn btn-primary btn-block"> Register </button>  
                                
                                <div className="sign-up">  
                                    Already have an account? <Link to='/login'>Login</Link>  
                                </div>  
                            </form>  
                        </div>  
                    </div>  
            </div>  
    </div>
</div>

  )
}
